import React from "react";
import Card from "./Card";
import contacts from "../contacts";


function App() {
  for (let i = 0; contacts.length; i ++) {
    <Card name={contacts[i].name} img={contacts[i].imgURL} phone={contacts[i].phone} email={contacts[i].email} />
  }
}


export default App;
